import React from "react";
import MovieList from "../../components/MovieList/MovieList";
import { movies } from "../../data/movies";

const Home = () => {
  console.log("home");
  return (
    <React.Fragment>
      <div className="row">
        <MovieList movies={movies} />
      </div>
    </React.Fragment>
  );
};

export default Home;
